  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Lake Andes NWR
  outlines Refuge accomplishments from May through August of 1953. The report begins
  by summarizing the weather conditions, water conditions, and food and cover during
  this period. Wildlife- including migratory birds, upland game birds, big game animals,
  furbearers, predators, rodents, mammals, raptors, and fish- is also covered. The
  Refuge development and maintenance section discusses physical developments and plantings.
  Resource management is outlined; topics include grazing. The public relations section
  of the report describes recreational uses, Refuge visitors, Refuge participation,
  and fishing. Items of interest, N-R forms, and photographs are attached.\",\n\t\"owner_org\":
